import React from "react";
import ChatStyled from "./ChatStyled";

function Chat() {

  return (
    <ChatStyled>
      <div className="chat-all">
        <div className="header">
            <div className="header-left">
                <h4> #Nom de la discussion </h4>
            </div>
            <div className="header-right">
            </div>
        </div>
      </div>



     

    </ChatStyled>
  );
}

export default Chat;
